<p>“<ruby>赶<rt>gǎn</rt></ruby><ruby>走<rt>zǒu</rt></ruby><ruby>了<rt>le</rt></ruby><ruby>我<rt>wǒ</rt></ruby>,<ruby>你<rt>nǐ</rt></ruby><ruby>会<rt>huì</rt></ruby><ruby>后<rt>hòu</rt></ruby><ruby>悔<rt>huǐ</rt></ruby><ruby>的<rt>de</rt></ruby>!”<ruby>影<rt>yǐng</rt></ruby><ruby>子<rt>zi</rt></ruby><ruby>不<rt>bù</rt></ruby><ruby>紧<rt>jǐn</rt></ruby><ruby>不<rt>bù</rt></ruby><ruby>慢<rt>màn</rt></ruby><ruby>地<rt>dì</rt></ruby><ruby>说<rt>shuō</rt></ruby>。</p>
